pragma solidity ^0.8.24;

contract Primitives{
    bool public boo = true;
    
    uint8 public u8 = 1;
    uint256 public u256 = 456;
    uint256 public u = 123;

    int8 public i8 = -1;
    int256 public i256 = 456;
    int256 public i = -123;

