    //字节类型
    bytes1 a = 0xb5;
    bytes1 b = 0x56;

    bool public defaultBool; // false
    uint256 public defaultUint; // 0
    int256 public defaultInt; // 0
    address public defaultAddr; // 0x0000000000000000000000000000000000000000

    
}

